import React from "react";
import { Luan } from "./component/luan/luan";
import "./App.css";
import { Dang,Tuan } from "./component/dang/dang";
import { BrowserRouter, Route, Routes } from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/luan" element={<Luan></Luan>}></Route>
        <Route path="/dang" element={<Luan></Luan>}></Route>
        <Route path="/tuan" element={<Luan></Luan>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
